import Home from "./Home";
import axios from "axios";

function Logout(props){
    const [data, onFetch ] = props;
    onFetch();
    try{
        const response = axios.post('http://localhost:8000/api/Logout/',data);
        alert(response.data)
    }catch (e) {
        console.log(e);
        alert("You haven't Logged in the system")
    }
    return Home;
}

export default Logout
